import { Grid, Paper, ThemeProvider, Typography } from "@mui/material";
import { Container } from "@mui/system";
import React from "react";
import HeroSection from "./components/HeroSection";
import ResponsiveAppBar from "./components/ResponsiveAppBar";
import GlobalStyled from "./config/GlobalStyled";
import defaultTheme from "./config/Theme/defaultTheme";

function App() {
  return (
    <>
      <ThemeProvider theme={defaultTheme}>
        <GlobalStyled />
        <Paper elevation={5}>
          <ResponsiveAppBar />
          <HeroSection />

          <Container maxWidth="xl" sx={{ mt: "5rem" }}>
            <Grid container spacing={3}>
              <Grid item xs={12} sm={6}>
                <Typography variant="h5">
                  Benefícios do Nosso Programa de Treinamento
                </Typography>
                <Typography variant="body1">
                  Participe de uma plataforma online totalmente profissional,
                  social, envolvente e interativa. Obtenha a experiência de
                  aprendizado que você merece.
                </Typography>
              </Grid>
            </Grid>
          </Container>
        </Paper>
      </ThemeProvider>
    </>
  );
}

export default App;
